import React from 'react';

export default function ListPage() {
  return (
    <div>
      <iframe className='w-[60vw] h-full' src="https://www.youtube.com/embed/R_IeYv6BGXk" title="&quot;Behemoth&quot; Hạng S bị nhầm là mèo và trở thành hiệp sĩ (thú cưng) của nàng Elf - Tập 02 [Việt sub]" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe>
    </div>
  );
}
